        </Wrapper>

    )
}

export default Header

const Wrapper = styled.div`
display: flex;
justify-content: space-between;
align-items: center;
min-width: 900px;
height: 5vh;
border: 3px solid black;
`

const Logo = styled.p`
margin-left: 15px;
`

